import React, { useState } from 'react';
import './Settings.css';

const Settings = () => {
  const [activeTab, setActiveTab] = useState('notifications');

  const renderContent = () => {
    switch (activeTab) {
      case 'notifications':
        return <div>Notification Settings</div>;
      case 'privacy':
        return <div>Privacy Settings</div>;
      default:
        return <div>Notification Settings</div>;
    }
  };

  return (
    <div className="settings-container">
      <div className="settings-header">
        <h1>Account Settings</h1>
        <p>Manage your preferences and account details</p>
      </div>
      <div className="settings-content">
        <div className="settings-sidebar">
          <button onClick={() => setActiveTab('notifications')}>Notifications</button>
          <button onClick={() => setActiveTab('privacy')}>Privacy</button>
        </div>
        <div className="settings-main">{renderContent()}</div>
      </div>
    </div>
  );
};

export default Settings;
